import React from "react";
import './photo.css';
import minhaFoto from './foto.jpg';

function Photo(){
    return(
        <div className="itsme">BEM VINDO, MEU NOME É GIOVANE MICOSSI
<img className="foto" src={minhaFoto} alt="minhaFoto" />
        </div>
    )
}

export default Photo;
